import React, { useState } from "react";



const OrdenItemDetail = ({title, price,quantity, id, subTotal}) => {
 




    return (
        <> 
            <View  style={styles.totalContainer} onPress={() => { }}>
                <View >
                    <Text style={styles.text1}> {quantity} units of {title} (${price}) | ${subTotal}  </Text> 
